// App.js
import React from 'react';
import { HashRouter as Router, Route, Switch, Link } from 'react-router-dom';

import Home from './Home';
import OutraRota from './OutraRota';

const App = () => {
  return (
    <Router>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/outra-rota">Outra Rota</Link>
          </li>
        </ul>
      </nav>

      <Switch>
        <Route path="/outra-rota">
          <OutraRota />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
